import React from 'react';
import { Switch, Route } from 'react-router-dom';
import { Layout } from 'antd';
import SideBarHome from '../../components/sidebar-home/sidebar-home.component';
import ContentHomePage from '../../components/content-homepage/content-homepage.component';
import CollectionPage from '../collection-page/collection-page.component';
import ProductDetailPage from '../product-detail-page/product-detail-page.component';

const HomePage = () => (

  <Layout>
    <SideBarHome />
    <Switch>
      <Route exact path="/" component={ContentHomePage} />
      <Route exact path="/productQuery" component={CollectionPage} />
      <Route exact path="/productQuery/2" component={ProductDetailPage} />
    </Switch>
  </Layout>

);
export default HomePage;
